INSERT INTO `wp_posts` VALUES (1,1,'2019-03-12 18:47:38','2019-03-12 18:47:38','<!-- wp:paragraph -->\n<p>Bienvenido a WordPress. Esta es tu primera entrada. Ed√≠tala o b√≥rrala, ¬°luego empieza a escribir!</p>\n<!-- /wp:paragraph -->','¬°Hola mundo!','','publish','open','open','','hola-mundo','','','2019-03-12 18:47:38','2019-03-12 18:47:38','',0,'http://localhost:8888/pinatasbolita/?p=1',0,'post','',1),(2,1,'2019-03-12 18:47:38','2019-03-12 18:47:38','<!-- wp:paragraph -->\n<p>Esta es una p√°gina de ejemplo. Es diferente a una entrada del blog porque permanecer√° en un solo lugar y aparecer√° en la navegaci√≥n de su sitio (en la mayor√≠a de los temas). La mayor√≠a de las personas comienzan con una p√°gina ¬´Acerca de¬ª que les presenta a los visitantes potenciales del sitio. Podr√≠a decir algo as√≠:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>¬°Bienvenido! Soy camarero de d√≠a, aspirante a actor de noche y esta es mi web. Vivo en Mairena del Alcor, tengo un perro que se llama Firulais y me gusta el rebujito. (Y las tardes largas con caf√©)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>‚Ä¶o algo as√≠:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>La empresa Mariscos Recio fue fundada por Antonio Recio Mata. Empez√≥ siendo una peque√±a empresa que suministraba marisco a hoteles y restaurantes, pero poco a poco se ha ido transformando en un gran imperio. Mariscos Recio, el mar al mejor precio.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como nuevo usuario de WordPress, deber√≠as ir a <a href=\"http://localhost:8888/pinatasbolita/wp-admin/\">tu escritorio</a> para borrar esta p√°gina y crear nuevas p√°ginas para tu contenido. ¬°P√°salo bien!</p>\n<!-- /wp:paragraph -->','P√°gina de ejemplo','','publish','closed','open','','pagina-ejemplo','','','2019-03-12 18:47:38','2019-03-12 18:47:38','',0,'http://localhost:8888/pinatasbolita/?page_id=2',0,'page','',0),(3,1,'2019-03-12 18:47:38','2019-03-12 18:47:38','<!-- wp:heading --><h2>Qui√©nes somos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>La direcci√≥n de nuestra web es: http://localhost:8888/pinatasbolita.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Qu√© datos personales recogemos y por qu√© los recogemos</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comentarios</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, as√≠ como la direcci√≥n IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la detecci√≥n de spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Una cadena an√≥nima creada a partir de tu direcci√≥n de correo electr√≥nico (tambi√©n llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la est√°s usando. La pol√≠tica de privacidad del servicio Gravatar est√° disponible aqu√≠: https://automattic.com/privacy/. Despu√©s de la aprobaci√≥n de tu comentario, la imagen de tu perfil es visible para el p√∫blico en el contexto de su comentario.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Medios</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si subes im√°genes a la web deber√≠as evitar subir im√°genes con datos de ubicaci√≥n (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de localizaci√≥n de las im√°genes de la web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formularios de contacto</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, direcci√≥n de correo electr√≥nico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendr√°n una duraci√≥n de un a√±o.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Cuando inicias sesi√≥n, tambi√©n instalaremos varias cookies para guardar tu informaci√≥n de inicio de sesi√≥n y tus opciones de visualizaci√≥n de pantalla. Las cookies de inicio de sesi√≥n duran dos d√≠as, y las cookies de opciones de pantalla duran un a√±o. Si seleccionas &quot;Recordarme&quot;, tu inicio de sesi√≥n perdurar√° durante dos semanas. Si sales de tu cuenta, las cookies de inicio de sesi√≥n se eliminar√°n.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si editas o publicas un art√≠culo se guardar√° una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del art√≠culo que acabas de editar. Caduca despu√©s de 1 d√≠a.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenido incrustado de otros sitios web</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Los art√≠culos de este sitio pueden incluir contenido incrustado (por ejemplo, v√≠deos, im√°genes, art√≠culos, etc.). El contenido incrustado de otras web se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interacci√≥n con ese contenido incrustado, incluido el seguimiento de tu interacci√≥n con el contenido incrustado si tienes una cuenta y est√°s conectado a esa web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Anal√≠tica</h3><!-- /wp:heading --><!-- wp:heading --><h2>Con qui√©n compartimos tus datos</h2><!-- /wp:heading --><!-- wp:heading --><h2>Cu√°nto tiempo conservamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos autom√°ticamente en lugar de mantenerlos en una cola de moderaci√≥n.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>De los usuarios que se registran en nuestra web (si los hay), tambi√©n almacenamos la informaci√≥n personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su informaci√≥n personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web tambi√©n pueden ver y editar esa informaci√≥n.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Qu√© derechos tienes sobre tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportaci√≥n de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. Tambi√©n puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ning√∫n dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>D√≥nde enviamos tus datos</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Los comentarios de los visitantes puede que los revise un servicio de detecci√≥n autom√°tica de spam.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Tu informaci√≥n de contacto</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informaci√≥n adicional</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>C√≥mo protegemos tus datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Qu√© procedimientos utilizamos contra las brechas de datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>De qu√© terceros recibimos datos</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Qu√© tipo de toma de decisiones automatizada y/o perfilado hacemos con los datos del usuario</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Requerimientos regulatorios de revelaci√≥n de informaci√≥n del sector</h3><!-- /wp:heading -->','Pol√≠tica de privacidad','','draft','closed','open','','politica-privacidad','','','2019-03-12 18:47:38','2019-03-12 18:47:38','',0,'http://localhost:8888/pinatasbolita/?page_id=3',0,'page','',0),(5,1,'2019-03-13 23:19:36','2019-03-13 23:19:36','','Tienda','','publish','closed','closed','','tienda','','','2019-03-13 23:19:36','2019-03-13 23:19:36','',0,'http://localhost:8888/pinatasbolita/tienda/',0,'page','',0),(6,1,'2019-03-13 23:19:36','2019-03-13 23:19:36','[woocommerce_cart]','Carrito','','publish','closed','closed','','carrito','','','2019-03-13 23:19:36','2019-03-13 23:19:36','',0,'http://localhost:8888/pinatasbolita/carrito/',0,'page','',0),(7,1,'2019-03-13 23:19:36','2019-03-13 23:19:36','[woocommerce_checkout]','Pago','','publish','closed','closed','','finalizar-comprar','','','2019-03-13 23:19:36','2019-03-13 23:19:36','',0,'http://localhost:8888/pinatasbolita/finalizar-comprar/',0,'page','',0),(8,1,'2019-03-13 23:19:36','2019-03-13 23:19:36','[woocommerce_my_account]','Mi cuenta','','publish','closed','closed','','mi-cuenta','','','2019-03-13 23:19:36','2019-03-13 23:19:36','',0,'http://localhost:8888/pinatasbolita/mi-cuenta/',0,'page','',0),(9,1,'2019-03-13 23:52:35','2019-03-13 23:52:35','','Prueba','','publish','closed','closed','','prueba','','','2019-03-13 23:52:35','2019-03-13 23:52:35','',0,'http://localhost:8888/pinatasbolita/?page_id=9',0,'page','',0),(10,1,'2019-03-13 23:52:35','2019-03-13 23:52:35','','Prueba','','inherit','closed','closed','','9-revision-v1','','','2019-03-13 23:52:35','2019-03-13 23:52:35','',9,'http://localhost:8888/pinatasbolita/9-revision-v1/',0,'revision','',0),(11,1,'2019-03-13 23:55:02','0000-00-00 00:00:00','','Inicio','','draft','closed','closed','','','','','2019-03-13 23:55:02','0000-00-00 00:00:00','',0,'http://localhost:8888/pinatasbolita/?p=